Fel vid laddning av ursprungligt spelinnehåll, kan inte ladda filen: {0} 

Ursprungligt spelinnehåll har förmodligen ändrats, återställ eventuella ändringar och försök igen. Bästa sättet att göra det är att ta bort mappen "SpaceEngineers\Content\Data" och välj sedan i Steam "Verifiera lokala spel cache". 

Att installera om spelet är inte tillräckligt, eftersom Steam inte tar bort okända filer!
